    <style>body,html{padding:0;margin:0;width:100%;height:100%;background:linear-gradient(#cfcfcf,#fff)}body{display:flex;justify-content:center;align-items:center;}</style>
    <style>.MuiCircularProgress-root{display:inline-block}.MuiCircularProgress-static{
      transition:transform .3s cubic-bezier(.4,0,.2,1) 0s}
      .MuiCircularProgress-indeterminate{
        animation:MuiCircularProgress-keyframes-circular-rotate 1.4s linear infinite}
        .MuiCircularProgress-determinate{transition:transform .3s cubic-bezier(.4,0,.2,1) 0s}
        .MuiCircularProgress-colorPrimary{color:#4CAF50}
        .MuiCircularProgress-colorSecondary{color:#973503}
        .MuiCircularProgress-svg{display:block;animation:loading_animation 1.4s infinite}
        .MuiCircularProgress-circle{stroke:currentColor}
        .MuiCircularProgress-circleStatic{transition:stroke-dashoffset .3s cubic-bezier(.4,0,.2,1) 0s}
        .MuiCircularProgress-circleIndeterminate{animation:MuiCircularProgress-keyframes-circular-dash 1.4s ease-in-out infinite;stroke-dasharray:80px,200px;stroke-dashoffset:0}.MuiCircularProgress-circleDeterminate{transition:stroke-dashoffset .3s cubic-bezier(.4,0,.2,1) 0s}@keyframes MuiCircularProgress-keyframes-circular-rotate{0%{transform-origin:50% 50%}100%{transform:rotate(360deg)}}@keyframes MuiCircularProgress-keyframes-circular-dash{0%{stroke-dasharray:1px,200px;stroke-dashoffset:0}50%{stroke-dasharray:100px,200px;stroke-dashoffset:-15px}100%{stroke-dasharray:100px,200px;stroke-dashoffset:-125px}}
        .MuiCircularProgress-circleDisableShrink{animation:none}@keyframes loading_animation{0%{color:#4CAF50}25%{color:#973503}50%{color:#FFBB00}75%{color:#CFCFCF}}</style>
  </head>
